module.exports = (function(){
    /** CONSTANTS **/
    var DEF = require('../constants');
    
    /** AUGMENTS **/
    require('../augments-ecma')();
    require('../augments-html')(); 
    
    /** BEGIN KASKADE **/
    var Kaskade = new Function();
    var $k = new Kaskade();
    
    Kaskade.prototype.constructor = Kaskade;
    
    var connection = require('./connection');
    Kaskade.prototype.connection = connection;
    Kaskade.prototype.method = connection.method;
    Kaskade.prototype.execute = connection.execute;
    
    Kaskade.prototype.data = require('./data-client');
    
    return $k;
})();

module.exports = function() {
    /** ADDEVENTHANDLER **/
    HTMLElement.prototype.addEventHandler = function(events, callback) {
        if (!( events instanceof Array))
            events = [events];
        for (var i = 0, len = events.length; i < len; i++) {
            if (this.addEventListener) {
                this.addEventListener(events[i], callback, false);
            } else {
                this.attachEvent('on' + events[i], callback);
                this.attachEvent(events[i], callback);
            }
        }
    };
    /** /ADDEVENTHANDLER **/

    /** DATASET SHIM **/
    HTMLElement.prototype.getDataset = function() {
        if (this.dataset)
            return this.dataset;

        function DomStringMap() {
        };
        var dataset = new DomStringMap();

        [].filter.call(this.attributes, function(element) {

            if (/^data-/.test(element.nodeName)) {

                var key = element.name || element.nodeName, value = element.value || element.nodeValue;

                key = key.replace(/^data-/, '').camelCase();
                dataset[key] = value;

            }

        });

        return dataset;
    };
    /** /DATASET SHIM **/

    /** CLASSLIST SHIM **/
    (function() {
        if ( typeof window.Element === "undefined" || "classList" in document.documentElement)
            return;

        var prototype = Array.prototype, push = prototype.push, splice = prototype.splice, join = prototype.join;

        function DOMTokenList(el) {
            this.el = el;
            // The className needs to be trimmed and split on whitespace
            // to retrieve a list of classes.
            var classes = el.className.replace(/^\s+|\s+$/g, '').split(/\s+/);
            for (var i = 0; i < classes.length; i++) {
                push.call(this, classes[i]);
            }
        };

        DOMTokenList.prototype = {
            add : function(token) {
                if (this.contains(token))
                    return;
                push.call(this, token);
                this.el.className = this.toString();
            },
            contains : function(token) {
                return this.el.className.indexOf(token) != -1;
            },
            item : function(index) {
                return this[index] || null;
            },
            remove : function(token) {
                if (!this.contains(token))
                    return;
                for (var i = 0; i < this.length; i++) {
                    if (this[i] == token)
                        break;
                }
                splice.call(this, i, 1);
                this.el.className = this.toString();
            },
            toString : function() {
                return join.call(this, ' ');
            },
            toggle : function(token) {
                if (!this.contains(token)) {
                    this.add(token);
                } else {
                    this.remove(token);
                }

                return this.contains(token);
            }
        };

        window.DOMTokenList = DOMTokenList;

        function defineElementGetter(obj, prop, getter) {
            if (Object.defineProperty) {
                Object.defineProperty(obj, prop, {
                    get : getter
                });
            } else {
                obj.__defineGetter__(prop, getter);
            }
        }

        defineElementGetter(Element.prototype, 'classList', function() {
            return new DOMTokenList(this);
        });
    })();
    /** /CLASSLIST SHIM **/
};

/** SOCKJS **/
var SockJS = require('./sockjs-client');
var uuid = require('node-uuid');
var self = module.exports;

self.connect = function connect(url) {
    var self = this;
    url = url || '/kaskade';

    self.open = false;

    self.sockjs = new SockJS(url);

    self.sockjs.onopen = function() {
        self.open = true;
        self.send.processQueue();
    };
    self.sockjs.onmessage = function(e) {
        self.parseMessage(e.data);
    };
    self.sockjs.onclose = function() {
        self.open = false;
    };
};

/** @function send
 *  Executes the sockjs send command when open, or queues commands when not yet open
 */
self.send = function send(message) {
    if (self.open)
        self.sockjs.send(message);
    else {
        send.queue = send.queue || [];
        send.queue.push(message);
    }
};
self.send.processQueue = function() {
    if (self.queue) {
        while (self.queue.length) {
            self(self.queue.shift());
        }
    }
};

/** @function method
 *  Creates and keeps references to all konnekt client/server methods
 *  @param {String} name
 *  @param {Function} definition
 *      @param {Object} parameters
 *      @param {Function} done(return_value)
 */
self.method = function method(name, definition) {
    method.stack = method.stack || {};
    method.stack[name] = definition;
};

/** @function exec
 *  Executes a method registered on the server
 *  @param {String} name
 *  @param {Object} params
 *  @param {Function} done(params)
 */
self.execute = function execute(name, params, done) {
    var id = uuid.v1();
    var obj = {
        type : 'execute',
        data : {
            id : id,
            name : name,
            params : params
        }
    };
    var msg = JSON.stringify(obj);

    execute.return_stack = self.return_stack || {};
    execute.return_stack[id] = done;

    self.send(msg);
};

/** @function parseMessage
 *  Parses the data from a socket message
 */
self.parseMessage = function(msg) {
    var obj = JSON.parse(msg);
    var type = obj.type;
    var data = obj.data;

    if (type == 'response') {
        var id = data.id;
        var params = data.params;
        if (self.execute.return_stack[id] instanceof Function) {
            self.execute.return_stack[id](params);
            delete self.execute.return_stack[id];
        }
    } else if (type == 'execute') {
        var name = data.name;
        var params = data.params;
        if (self.method.stack[name] instanceof Function)
            self.method.stack[name](params);
    }
};

module.exports = function() {
    /** OBJECT AUGMENTATION **/
    Object.isEqual = function(a, b) {
        if (Object.keys(a).length == Object.keys(b).length) {
            for (var k in a) {
                if (a[k] !== b[k])
                    return false;
                return true;
            }
        }
        return false;
    };
    /** /OBJECT AUGMENTATION **/

    /** ARRAY AUGMENTATION **/
    Array.prototype.remove = function(element) {
        var index = this.indexOf(element);
        if (index >= 0)
            this.splice(index, 1);
        return index;
    };
    Array.prototype.add = function(element) {
        if (this.indexOf(element) < 0)
            this.push(element);
    };
    Array.prototype.last = function() {
        return this[this.length - 1];
    };
    Array.prototype.clone = function() {
        return this.slice(0);
    };
    Object.defineProperties(Array.prototype, {
        remove : {
            enumerable : false
        },
        add : {
            enumerable : false
        },
        last : {
            enumerable : false
        },
        clone : {
            enumerable : false
        }
    });
    /** /ARRAY AUGMENTATION **/

    /** STRING AUGMENTATION **/
    String.prototype.camelCase = function() {
        var arr = this.split('-');
        for (var i = 1, len = arr.length; i < len; i++) {
            arr[i] = arr[i].charAt(0).toUpperCase() + arr[i].slice(1);
        }
        return arr.join('');
    };
    /** /STRING AUGMENTATION **/
};

module.exports = {
    SRV_COL_SELECT: '__server_collection_select__',
    SRV_COL_OBSERVE: '__server_collection_observe__',
    SRV_COL_MUTATE: '__server_collection_mutate__',
    CON_COL_MUTATE: '__conn_collection_mutate__'
};

var self = module.exports;
var DEF = require('../constants');
var connection = require('./connection');

self.Collection = (function(){
    var Collection = function(cfg){
        var collection = this;
        var cfg = cfg || {};
        
        collection.name = cfg.name;
        collection.keyField = cfg.keyField;
        collection.observers = {};
        collection.observerCallbacks = {};
        collection.records = {};
        
        Collection.collections[collection.name] = collection;
    };
    
    Collection.collections = {};
    
    Collection.prototype.select = function(query, done){
        var collection = this;
        var params = {
            name: collection.name,
            query: query
        };
        connection.execute(DEF.SRV_COL_SELECT, params, function(records){
            var obj = {};
            var keyField = collection.keyField;
            records.reduce(function(o, v){
                var key = v[keyField];
                o[key] = v;
                return o;
            }, obj);
            done(obj);
        });
    };
    
    Collection.prototype.observe = function(query, callback){
        var collection = this;
        var params = {
            name: collection.name,
            query: query
        };
        connection.execute(DEF.SRV_COL_OBSERVE, params, function(ret){
            var observerId = ret.observerId;
            collection.observerCallbacks[observerId] = callback;
            connection.execute(DEF.SRV_COL_SELECT, params, function(records){
                var obj = {};
                var keyField = collection.keyField;
                records.reduce(function(o, v){
                    var key = v[keyField];
                    collection.records[key] = v;
                    o[key] = v;
                    return o;
                }, obj);
                collection.observers[observerId] = obj;
                collection.observerCallbacks[observerId]('init', obj);
            });
        });
    };
    
    Collection.prototype.insert = function(record){
        var collection = this;
        var params = {
            name: collection.name,
            method: 'insert',
            record: record
        };
        connection.execute(DEF.SRV_COL_MUTATE, params);
    };
    
    Collection.prototype.update = function(query, update){
        var collection = this;
        var params = {
            name: collection.name,
            method: 'update',
            query: query,
            update: update
        };
        connection.execute(DEF.SRV_COL_MUTATE, params);
    };
    
    Collection.prototype.remove = function(query){
        var collection = this;
        var params = {
            name: collection.name,
            method: 'remove',
            query: query
        };
        connection.execute(DEF.SRV_COL_MUTATE, params);
    };
    
    Collection.prototype.__handleMutation = function(method, observerId, record){
        var collection = this;
        var records = collection.records;
        var observer = collection.observers[observerId];
        var callback = collection.observerCallbacks[observerId];
        var keyField = collection.keyField;
        
        callback = callback instanceof Function ? callback : new Function();
        
        switch(method){
            case 'insert':
                var key = record[keyField];
                records[key] = record;
                observer[key] = record;
                //Notify Listeners
                callback('insert', record);
                break;
            case 'update':
                var key = record[keyField];
                records[key] = record;
                observer[key] = record;
                //Notify Listeners
                callback('update', record);
                break;
            case 'remove':
                var key = record[keyField];
                delete records[key];
                delete observer[key];
                //Notify Listeners
                callback('remove', record);
                break;
        };
        
    };
    
    return Collection;
    
})();
connection.method(DEF.CON_COL_MUTATE, function(params){
    console.log(params);
    var collection = self.Collection.collections[params.name];
    var method = params.method;
    var observerId = params.observerId;
    var record = params.record;
    
    collection.__handleMutation(method, observerId, record);
});

